export default function TodoItem(props) {

	return(
		<div className="todo__item">
			<div className="todo__item__content">
				<div className="todo__item__title"> {props.post.title} </div>
				<div className="todo__item__text"> {props.post.text} </div>
			</div>
			<button className="todo__item__btn"> delete </button>
		</div>
	)

}
